const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14
  const allExercises = {exercises1, exercises2, exercises3}

  return (
    <div>
      <Header course = {course} />
      <Content name = {part1} exercise = {exercises1} />
      <Content name = {part2} exercise = {exercises2} />
      <Content name = {part3} exercise = {exercises3} />
      <Total allExercises = {allExercises} />
      <p>Number of exercises {exercises1 + exercises2 + exercises3}</p>
    </div>
  )
}

const Header = (props) => {
  return (
    <div>
      {props.course}
    </div>
  )
}

const Content = (props) => {
  return (
    <div>
      <p>{props.name} {props.exercise}</p>
    </div>
  )
}

const Total = (props) => {
  return (
    <div>
      <p></p>
      Number of exercises {props.allExercises.exercises1}
    </div>
  )
}

export default App
